{'id': 1721, 'userFid': '498701', 'projectName': 'Dynamic Inbox Contract For OP Stack', 'ecosystem': 'Optimism', 'category': 'OP Stack', 'subcategory': '', 'secondaryecosystem': None, 'contribution': 'Dynamic Inbox Contract For OP Stack', 'desc': 'This feature aims to allow the batch inbox to be a contract, enabling customized batch submission conditions such as:

Requiring the batch transaction to be signed by a quorum of sequencers in a decentralized sequencing network; or
Mandating that the batch transaction call a BLOB storage contract (e.g., EthStorage) with a long-term storage fee, which is then distributed to data nodes that prove BLOB storage over time.', 'link': '', 'ethAddress': '0x0000000000000000000000000000000000000000', 'primarycontributionuid': '0x7c2460f0e048edd08abb4279db8fc5318168145672399cb37c9f19c9381d5273', 'easUid': '0x63ea89d56d7e384e6ebb5b050c2cf0f06026cb9bcc5d634b39ab7acc07793b1b', 'createdAt': '2024-09-05T10:33:06.803Z', 'data': {'feeling_if_didnt_exist': '1', 'explanation': 'While this is an interesting idea, the code has not been fully written or ran in production, meaning that it has yet to produce impact.'}}

{'id': 1735, 'userFid': '8687', 'projectName': 'ethereumjs-monorepo', 'ecosystem': 'Optimism', 'category': 'OP Stack', 'subcategory': '', 'secondaryecosystem': None, 'contribution': 'ethereumjs-monorepo', 'desc': 'A collection of Javascript/TypeScript libraries implementing Ethereum primitives, including an implementation of the Ethereum Virtual Machine (EVM) ready to be used in Node.js or a browser environment, implementations of core structural blockchain building blocks like an Ethereum Tx, Block or Blockchain as well as a Trie (Merkle Patricia Tree), devp2p (execution networking layer) implementation, and an experimental Verkle Trie implementation.

Above are complemented by helper packages like RLP for data encoding/decoding or Util, providing helper functionalities like (byte) conversion, signatures, types and others.

Finally, the EthereumJS Execution Client is fully functional Execution Layer client used mainly testing out of new EIP implementations as well as participating in devnets and testnets preparing for hardfork upgrades.', 'link': 'https://github.com/ethereumjs/ethereumjs-monorepo', 'ethAddress': '0x0000000000000000000000000000000000000000', 'primarycontributionuid': '0x6830f24e2e893931d62d8118146a7bbffb5cd1f78945318865a52bd6a6cbe245', 'easUid': '0x94733e44a697606e2427cb33be6e0b8005bd98e1291d914bd39bf16e35d06291', 'createdAt': '2024-09-06T10:35:01.165Z', 'data': {'feeling_if_didnt_exist': '1', 'explanation': 'The ethereumjs-monorepo should consider adding OP Stack support natively before receiving retro funding. See the following github issue: https://github.com/ethereumjs/ethereumjs-monorepo/issues/3255. The OP Stack now uses foundry rather than hardhat and no longer depends on Javascript for development.'}}

{'id': 1746, 'userFid': '465226', 'projectName': "Formal Verification of Optimism's L1 pausability mechanism", 'ecosystem': 'Optimism', 'category': 'OP Stack', 'subcategory': '', 'secondaryecosystem': None, 'contribution': "Formal Verification of Optimism's L1 pausability mechanism", 'desc': 'Runtime Verification has contributed to the security of OP Stack through formal verification proofs of the L1 pausability mechanism. Our open-source formal verification tool, Kontrol, has been successfully integrated into the Optimism CI to continuously ensure that the pausability mechanism remains intact as the code evolves. 

The proofs with their respective documentation can be found at https://github.com/ethereum-optimism/optimism/tree/develop/packages/contracts-bedrock/test/kontrol. 

Kontrol is an open source, free-to-use tool, which means that the existing and future proofs can be maintained by the Optimism team. At the same time, Kontrol is actively maintained and improved by our team at Runtime Verification, thus ensuring constant performance and user experience enhancements, which are regularly upstreamed to the Optimism monorepo.', 'link': 'https://runtimeverification.com/', 'ethAddress': '0x0000000000000000000000000000000000000000', 'primarycontributionuid': '0x80393c05d524b7a6f7a78b0c141eadf0759642ae8d7e718134318cd2d73d5464', 'easUid': '0x41df4478dda90d3747dce43ae2e0e84a029c0e7d04f651b53c9fe1fb75cfe497', 'createdAt': '2024-09-06T10:35:04.686Z', 'data': {'feeling_if_didnt_exist': '3', 'explanation': 'This contribution was key in making sure that the bridge is secure. The OP Labs team defined an invariant that value cannot leave the bridge when it is paused and this contribution helped to prove that property.'}}

