{'id': 1688, 'userFid': '779819', 'projectName': 'Hermes - a GossipSub listener and tracer for libp2p-based networks.', 'ecosystem': 'Optimism', 'category': 'OP Stack', 'subcategory': '', 'secondaryecosystem': None, 'contribution': 'Hermes - a GossipSub listener and tracer for libp2p-based networks.', 'desc': 'The ProbeLab team has recently built Hermes, a GossipSub listener and tracer for libp2p-based networks. Hermes-based experiments aim to measure the efficiency and performance of the GossipSub message broadcasting protocol in any libp2p-based network. Acting as a light node of sorts, Hermes can help developers collect valuable data and tune their network’s protocols based on the message propagation latency, control message overhead and a variety of other metrics. Hermes currently supports the Ethereum consensus layer network.

The ProbeLab team specialises in network-layer measurements and monitoring. The team operates a variety of tools and uses the data it collects to propose network protocol optimisations.', 'link': 'https://probelab.io', 'ethAddress': '0x0000000000000000000000000000000000000000', 'primarycontributionuid': '0x7504e494cb8d227193182e083128912173c14eaeecec9b90fa453de28377b269', 'easUid': '0x691e3c9c6e8902d3d5fbaaad0dd467be7fa4577948e38a98f2db286cdd6c82a2', 'createdAt': '2024-09-04T19:49:13.301Z', 'data': {'feeling_if_didnt_exist': 'Extremely Upset', 'explanation': 'The work from Probelabs is very crucial for analyzing ethereum p2p layer behavior for both EL & CL clients.

Before Hermes, we would only be able to rely on client implementations and their exposed metrics to analyze how the network behaves, and with Hermes, we could do it in a client agnostic way, join the network as a standalone phantom node to observe as close as possible while with the flexibility to add whatever metrics / features we would love for monitoring and analysis.'}}

{'id': 1728, 'userFid': '11652', 'projectName': 'Ethereum devnets and testing tools', 'ecosystem': 'Optimism', 'category': 'OP Stack', 'subcategory': 'Ethereum Core Contributions', 'secondaryecosystem': None, 'contribution': 'Ethereum devnets and testing tools', 'desc': 'As a team, we focus on Ethereum testing and protocol upgrades. In order to do this well, We build and maintain many projects that help ship Ethereum upgrades safely and quickly. A full list of our open-source tools can be found on our website at https://ethpandaops.io/projects/.  

One of the major projects the team undertakes is supporting Ethereum hardforks with devnets. Devnets are fully-fledged Ethereum networks that we use for testing new features. We have infrastructure tooling that makes it possible to run a local devnet on your machine. For more intricate tests and networks, we also provide tools to deploy nodes across multiple remote servers. All of these networks come with tools to analyze, test, and debug them. Devnets help Ethereum core developers to make their clients more reliable by identifying issues before they happen on Ethereum mainnet. ', 'link': 'https://ethpandaops.io', 'ethAddress': '0x0000000000000000000000000000000000000000', 'primarycontributionuid': '0xa17b3d5e5ef47fe50e56d9fea3c4c90e72b0c9127b8eab54058e5ca82111378c', 'easUid': '0xc454b1d4351004722346a0d51da5410b6b71b20fb9110e851598c674e87ad5ef', 'createdAt': '2024-09-05T10:33:09.533Z', 'data': {'feeling_if_didnt_exist': 'Extremely Upset', 'explanation': "EthPandaOps has been doing an incredible job for Ethereum's infrastructures! They are also building decent toolings for OP Stack infrastructures as well. Appreciate their work :)

"}}

